import React, { Component } from 'react';

import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Switch, Route, BrowserRouter } from 'react-router-dom';
import uuid from 'uuid';

import Navi from './components/Navi';
import Inpu from './components/Inpu';
import List from './components/List';

import Abou from './routes/Abou';
import Crea from './routes/Crea';
import Help from './routes/Help';
import Logi from './routes/Logi';
import Sign from './routes/Sign';
import Notf from './routes/Notf';
import Foot from './routes/Foot';

class App extends Component {
  render() {

    return (
      <BrowserRouter>
        <div>      
          <Navi />
          <Switch>
            <Route path="/Abou"   component={Abou} />
            <Route path="/Crea"   component={Crea} /> 
            <Route path="/Help"   component={Help} />
            <Route path="/Logi"   component={Logi} />
            <Route exact path="/" activeClassName="active" component={Sign} exact={true} />

            <Route component={Notf} />
          </Switch> 

        </div>

      </BrowserRouter>

    );
  }
}

export default App;
